import React from 'react';
import SwiperCore, { EffectCoverflow, Pagination, Keyboard, Mousewheel } from 'swiper';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';

SwiperCore.use([EffectCoverflow, Pagination, Keyboard, Mousewheel]);

const EventSlider = () => {
  const events = [
    { id: 1, category: 'domestic', title: 'Enjoy the exotic of sunny Hawaii', location: 'Maui, Hawaii' },
    { id: 2, category: 'subtropical', title: 'The Island of Eternal Spring', location: 'Lanzarote, Spanien' },
    { id: 3, category: 'history', title: 'Awesome Eiffel Tower', location: 'Paris, France' },
    { id: 4, category: 'Mayans', title: 'One of the safest states in Mexico', location: 'The Yucatan, Mexico' },
    { id: 5, category: 'native', title: 'The most popular yachting destination', location: 'Whitsunday Islands, Australia' },
  ];

  return (
    <section>
      <Swiper
        effect="coverflow"
        grabCursor={true}
        centeredSlides={true}
        slidesPerView="auto"
        coverflowEffect={{
          rotate: 0,
          stretch: 0,
          depth: 100,
          modifier: 2,
          slideShadows: true
        }}
        keyboard={{ enabled: true }}
        mousewheel={{ thresholdDelta: 70 }}
        spaceBetween={60}
        loop={true}
        pagination={{ clickable: true }}
      >
        {events.map((event) => (
          <SwiperSlide key={event.id} className={`swiper-slide swiper-slide--${event.category}`}>
            <span>{event.category}</span>
            <div>
              <h2>{event.title}</h2>
              <p>
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" className="w-6 h-6">
                  <path stroke-linecap="round" stroke-linejoin="round" d="M15 10.5a3 3 0 11-6 0 3 3 0 016 0z" />
                  <path stroke-linecap="round" stroke-linejoin="round" d="M19.5 10.5c0 7.142-7.5 11.25-7.5 11.25S4.5 17.642 4.5 10.5a7.5 7.5 0 1115 0z" />
                </svg>
                {event.location}
              </p>
            </div>
          </SwiperSlide>
        ))}
      </Swiper>
    </section>
  );
};

export default EventSlider;
